RecipeInstructions:
c("Prepare Filling: Beat first 3 ingredients at medium speed with an electric mixer until blended and smooth. Add egg, flour, and vanilla; beat just until blended.", "Prepare Batter: Preheat oven to 350º. Bake pecans in a shallow pan 8 to 10 minutes or until toasted and fragrant, stirring halfway through. Stir together 3 cups flour and next 7 ingredients in a large bowl; stir in eggs and next 3 ingredients, stirring just until dry ingredients are moistened. Stir in apples and pecans.", "Spoon two-thirds of apple mixture into a greased and floured 14-cup Bundt pan. Spoon Cream Cheese Filling over apple mixture, leaving a 1-inch border around edges of pan. Swirl filling through apple mixture using a paring knife. Spoon remaining apple mixture over Cream Cheese Filling.", 
"Bake at 350º for 1 hour to 1 hour and 15 minutes or until a long wooden pick inserted in center comes out clean. Cool cake in pan on a wire rack 15 minutes; remove from pan to wire rack, and cool completely (about 2 hours).", "Prepare Frosting: Bring 1/2 cup brown sugar, 1/4 cup butter, and 3 tablespoons milk to a boil in a 2-qt. saucepan over medium heat, whisking constantly; boil 1 minute, whisking constantly. Remove from heat; stir in vanilla. Gradually whisk in powdered sugar until smooth; stir gently 3 to 5 minutes or until mixture begins to cool and thickens slightly. Pour immediately over cooled cake."
)

c("Preheat the oven 175°C and grease and line a loaf tin with baking paper (about a 1 Litre capacity).", "Place the orange and lemon zest with the caster sugar in the mixing bowl. Rub the zest into the sugar until most of the sugar has turned into a nice lemony colour (this infuses the sugar with the citrus oil).", "Stir in the flour, cinnamon, salt and baking powder.", "In a separate bowl, whisk together the oil, eggs and orange juice.", "Beat the wet ingredients into the dry ingredients until you have a smooth batter.", 
"Spoon a third of the batter into the loaf tin and scatter over about half the diced quince paste. Spoon another third of the batter, scatter some more quince paste over then pour the remaining mixture over the top.", "Bake for 10 minutes then dot more quince paste over the top.", "Bake for a further 30 minutes or until it's well risen and a skewer comes out clean when inserted into the cake.", "Remove from oven and allow the cake to completely cool in the tin.", "Dust the top with icing sugar and serve with a dollop of marscarpone and fresh orange slices. Store the cake in an airtight container (it'll keep for a week)."
)

c("Cake:", "In large bowl of electric mixer, let egg whites warm to room temperature - about 1 hour.", "Preheat oven to 325 degrees Fahrenheit.", "Place cocoa in small bowl; add boiling water, stirring until smooth.  Let mixture cool about 20 minutes.", "Into a 2nd large bowl, sift flour with granulated sugar, soda and salt.  Make a well in center; pour in salad oil, egg yolks, vanilla and cooled cocoa mixture.  With spoon or electric mixer, beat just until smooth.", "Sprinkle cream of tartar over egg whites.  With mixer at high speed, beat until very stiff peaks form when beater is slowly raised.  Do not underbeat.", 
"Pour batter over egg whites; with rubber scraper or wire whisk, gently fold in just until blended.  Turn batter into ungreased 10-inch tube pan.", "Bake 60 minutes, or until cake springs back when gently pressed.", "Coffee Butter Frosting:", "In a medium bowl, combining butter, sugar, coffee, 2 tablespoons hot milk and the vanilla.", "With electric mixer at medium speed, or wooden spoon, beat mixture until smooth and fluffy.", "If frosting seems too thick to spread, gradually beat in a little more hot milk."
)

c("Heat peach nectar in microwave for 1-2 minutes or until very hot but not boiling.", "Pour over gelatin and stir till combined.", "Cool in fridge for 15 minutes.", "Cut the peach slices into 1/2\" pieces.", "Stir peaches into ricotta then add in the gelatin mixture.", "Chill another 30 minutes or until just set.", "Meanwhile, using a serrated knife, cut top off angel food cake & hollow out center leaving a 1\" edge.", "Eat the leftover cake pieces as a snack while you finish up the recipe.", "Spoon cooled gelatin/ricotta/peach mixture into angel food shell & replace the top.", 
"I usually have a couple of tablespoons too much filling.  That's the cook's snack # 2.", "**Tip - if you find that the center edge of the cake tries to fold in under the weight of the filling, place a juice glass in the hollow center.  Remove it before serving.", "Stir extract into whipped topping & frost the cake.", "Garnish with peach slices, if desired.", "Chill at least 1 hour before serving & keep any leftovers refrigerated.", "Note:  I've made this in a hurry & rather than hollowing out the cake, I cut it up into 1\" cubes & layered it with the filling for a trifle type dessert."
)

c("You need a large bowl or dish pan to mix this inches.", "Measure the whole wheat flour, buckwheat flour, soy flour, dry buttermilk, salt, baking powder and sugar into the large bowl.", "Using a whisk or your hands, combine everything so it's evenly distributed.", "Measure in the shortening.", "Use your hands to mash it into the dry ingredients, until the mixture is the same consistency as coarse cornmeal.", "Transfer the mixture to a resealable container.  Store on the pantry shelf for about a month, or in the refrigerator or freezer for 6 months.", 
"Makes about 7-1/2 cups.", "TO PREPARE:  Stir the water and 1 cup mix together in a small bowl.", "If the batter seems too thick for pancakes, then add a bit more water and stir again.", "Drop by 1/4 cupfuls onto a hot, well oiled skillet or griddle.", "Fry until the bottom of the pancake is brown and the top is dry and covered with small bubbles.", "Flip the pancake and brown it on the second side.", "Serve hot with syrup, or Applesauce.", "Makes 4 pancakes.", "This recipe can be doubled or tripled as necessary."
)

c("Preheat oven to 350°F  Grease two 9-inch cake pans.", "CAKE:  Melt chocolate and shortening together.  Cool.", "In a separate bowl, combine evaporated milk and vinegar  Reserve.", "In a medium bowl, beat sugars, eggs and vanilla until mixture is thick, about 3-5 minutes,.  Fold in chocolate mixture.  Beat until combined.", "Mix next 4 ingredients together.  Add half of dry mixture to wet ingredients.  Add milk mixture and then remaining dry mixture.  Fold in chocolate chips.  Divide batter between the two prepared cake pans.", 
"Bake in preheated oven 45-50 minutes or until a toothpick inserted in center of cakes comes out clean.", "FROSTING:  Beat cream cheese and butter until light and well combined.  Add icing sugar 1 cup at a time, beating well after each addition.  Beat in vanilla and chocolate.  Thin out with 1-2 Tbsp, of milk if necessary.", "ASSEMBLY:  Slice each cake in half horizontaly to create 4 layers.  Spread first layer with about 1 cup frosting, continue with each layer, icing top and sides of cake,  Refrigerate until ready to eat."
)

c("MICROWAVE chocolate, 1/2 cup sugar and water in large microwaveable bowl on HIGH 2 minute or until chocolate is almost melted, stirring after 1 minute Stir until chocolate is completely melted. Cool.", "MIX flour, baking soda and salt. Beat butter and remaining sugar in large bowl with mixer until light and fluffy. Add eggs, 1 at a time, beating after each until well blended. Beat in flour mixture alternately with milk. Add chocolate mixture and vanilla; mix well. Pour into 2 greased and floured 9-inch round pans.", 
"BAKE 30 to 35 minute or until toothpick inserted in centers comes out clean. Cool in pans 10 min.; remove from pans to wire racks. Cool completely.", "Frosting:", "Whisk together cocoa and 1/4 cup plus 2 tablespoons warm water in a bowl until cocoa dissolves. Beat butter, confectioners' sugar, and a generous pinch of coarse salt in a clean bowl with a mixer on medium speed until pale and fluffy. Gradually beat in melted chocolate and then cocoa mixture until combined. Let stand for 30 minutes before using."
)

c("Prepare pans: Two 8\" x 3\" loaf pans and two 9\" x 5\" loaf pans OR One 8\" square cake tin and one 6\" square cake tin. Cut heavy brown paper to fit pans. Generously butter inside of pans, then place paper inside pans, and generously butter the paper. This helps prevent the cakes from drying out during storage.", "Prepare fruit and nuts: Soak raisins in water, overnight if possible. Drain well.Roughly chop almonds.Cut glace cherries into quarters.", "Beat together butter and sugar.", "Add 8 whole eggs and 7 egg yolks to butter/sugar mixture. Mix well.", 
"Add fruit and nuts, lemon juice and rind, and flour, stirring well after each addition. Keep stirring until batter is well mixed.", "Beat egg whites until stiff. Fold into batter.", "Put batter into prepared pans.", "Bake about 3 hours in 300 degree F. oven.", "Let cool ten minutes in pans. Leaving the paper on the cakes, remove cakes from pans and let cool completely on racks. Wrap tightly in saran and then foil. Store in refrigerator or in a cool, dry place for several weeks, or freeze for up to one year."
)

c("Crust:", "Put oven rack in middle position and preheat oven to 350°F Lightly butter pie plate.", "Stir together all ingredients in a bowl and press evenly on bottom and up side of pie plate. Bake until crisp, 12 to 15 minutes, then cool on a rack to room temperature, about 45 minutes.", "Filling.", "Put oven rack in middle position and preheat oven to 350°F.", "Pulse sugar and ginger in a food processor until ginger is finely chopped, then add cream cheese and pulse until smooth. Add eggs, milk, flour, nutmeg, and salt and pulse until just combined.", 
"Reserve 2/3 cup cream cheese mixture in a glass measure. Whisk together remaining 1 1/3 cups cream cheese mixture and pumpkin in a large bowl until combined.", "Pour pumpkin mixture into gingersnap crumb crust. Stir reserved cream cheese mixture (in glass measure) and drizzle decoratively over top of pumpkin mixture, then, if desired, swirl with back of a spoon. Put pie on a baking sheet and bake until center is just set, 35 to 45 minutes. Transfer to a rack and cool to room temperature, about 2 hours, then chill, loosely covered with foil, at least 4 hours. If necessary, very gently blot any moisture from surface with paper towels before serving."
)

c("Preheat oven to 400°F Line a sheet pan with aluminum foil and arrange bacon on the pan. Bake 15 minutes until very crisp; immediately transfer bacon to paper towels to drain; let cool 5-10 minutes. Crumble bacon and toss with maple syrup. (Note that there is a total of 8 slices of bacon and 1/4 cup of maple syrup in this step.).", "Line a standard muffin pan with paper liners, and spray liners with non-stick spray.", "Whisk together flour, sugar, baking powder and salt in a large bowl. Add a third of the cooled bacon. In a second bowl, whisk together milk, eggs and melted butter. Pour the wet ingredients over the dry and stir just until fully moistened (there may be small lumps). Divide the batter evenly amongst the muffin cups and bake in the preheated oven until puffed and firm to the touch, about 10 minutes (they will not brown much). Cool in pan 5 minutes, then transfer to a wire rack until fully cooled.", 
"In the work bowl of a stand mixer fitted with the whisk, whip the butter on high until very light and fluffy, about 5 minutes, scraping down the sides of the bowl every minute or two. Turn the speed down to low and add the powdered sugar a little at a time; do not add more until it's nearly completely absorbed. Scrape down the sides of the bowl, turn up to medium-high and whip until fluffy, 1-2 minutes. Add maple syrup and vanilla and continue to whip 1 minute more. Add half the remaining bacon and stir in with a spatula. Frost the cooled cupcakes with an offset spatula. Top with more bacon."
)

c("Line 13x9 inch pan with foil, with ends of foil over sides. Mix wafer crumbs and butter until blended; press onto bottom of prepared pan. Bake 10 minute.", "Separate 1 egg; refrigerate yolk until ready to use. Beat cream cheese, 1 cup of sugar, flour, lemon zest, 2 tablespoons lemon juice and vanilla in large bowl with mixer until blended. Add egg white and remaining 3 whole eggs, 1 at a time, mixing on low speed after each just until blended. Pour over crust.", "Bake 40 minute or until center is almost set. Cool 1 hour. Refrigerate 4 hours.", 
"Mix cornstarch and remaining sugar in medium saucepan; gradually stir in water and remaining lemon juice until blended. Bring just to boil on medium heat, stirring constantly; cook and stir until clear and thickened. Lightly beat reserved egg yolk in small bowl with fork until blended; stir in 2 tablespoons of the hot cornstarch mixture. Return to remaining cornstarch mixture in saucepan; stir until blended. Cook 1 minute or until thickened, stirring constantly. Cool slightly.", "Spoon lemon glaze over cheesecake. Refrigerate 1 hour or until firm. Using foil handles to remove cheesecake from pan before cutting to serve."
)

c("Preheat oven to 350 degrees. Grease an 8” x 8” square cake pan.", "In a medium bowl, combine cream cheese, cake mix, melted butter, and a pinch of salt. Mix until smooth. Divide into 6 small bowls and tint each one with a different color.", "Place bread dough on a lightly floured work surface. Using a rolling pin, shape the dough into a rectangle, <U+215B>-inch thick and 13” x 10”.", "Spread each rainbow filling across dough in separate stripes, length-wise, getting as close to the edges as possible. Starting with the long, red side of the rectangle, roll the dough up into a log.", 
"Use a sharp knife or serrated bread knife to carefully slice the log into 9 equal portions. Transfer to prepared cake pan, placing rolls cut side up, 3-by-3. Transfer to oven and bake until golden and puffed, about 30 minutes. Let cool 10 minutes.", "Meanwhile, make glaze. Add confectioners’ sugar, milk, and vanilla to a large bowl. Whisk to combine, adding more milk if necessary to reach a consistency that is thick but pourable.", "Drizzle glaze immediately on cooled birthday cake rolls and top with rainbow sprinkles. Serve warm."
)

c("Dice yam into 1.5cm cube.", "Grate radish into 3mm thick strips.", "Coarsely chop washed dried shrimps and dried oyster. Press salted egg with a fork.", "Fry sliced shallots in 100ml oil until brown. Sieve out when done.", "In a non-stick pan, heat 1 tbsp oil. Sauté dried shrimps and dried oysters. Set aside when done.", "Sauté yam with a tbsp of oil in low heat for about 10 minutes or until it's heated through.", "Add radish and salted egg white and stir well.", "Cover with lit and cook for 15 minutes or until soften. Stir every 3 minutes.", 
"Add sautéed shrimps and oysters, spice powder and pepper powder.", "Mix flour, starch and sugar in chicken stalk. Pour liquid into pan and give the mixture a good stir.", "As it begin to thicken, stir in salted egg yolk.", "Turn off fire as it all sticks together. Transfer to a 5 cm deep tray lined with greased baking paper.", "Steam with lit on for 40 minutes with high heat. Refill hot water half way if necessary.", "Sprinkle with fried shallots, chopped scallions, sliced red chilli pepper and pounded roasted peanuts. Serves with shallot oil, chilli sauce and hoisin sauce."
)

c("Preheat a large iron skillet, or a griddle over medium heat. When ready to cook cakes, the pan/griddle should be hot enough to cause a few drops of water to dance on the surface,.", "Whisk together dry ingredients in a small bowl. In another medium bowl, beat egg and add milk and oil/butter, and mix to combine.", "Add dry ingredients to the liquid ingredients, stirring just untill all the flour is moistened. Batter will be a bit lumpy.", "Lightly spray pan/griddle with non-stick spray.  Portion batter in 1/4 to 1/3 cup cakes onto pan/griddle.", 
"Bake on this side till a few bubbles appear on the surface.  Flip and bake the second side for another minute or two till golden brown.", "Keep baked griddle cakes warm in a warm oven till all cakes are baked, Serve with butter and warmed maple syrup.", "Small fruits, such as bluberries, raspberries, chopped strawberries, diced peaches, even raisins, chopped pecans, and the like, can be added to the cakes while the first side is browning. Flip carefully and finish baking.", "For pineapple griddle cakes, add a 1/2 cup drained crushed pineapple to the batter, bake as directed, and serve with warmed honey."
)

c("For the cake; Preheat oven to 375 degrees Fahrenheit.", "Grease a 9 inch round baking dish, and dust it with flour.", "This is an excellent way to ensure that no part of the cake sticks to the dish when it is done.", "Beat the butter and sugar until creamy.", "Add one egg at a time to the creamy mixture and beat until fluffy.", "Sift the flour, cocoa, coffee and baking powder together.", "Mix the red food colouring and milk together.", "Combine all the mixtures in a large bowl and beat well till all the ingredients are well blended.", 
"Pour the batter into the prepared dish and bake for 45 minutes to 1 hour, or until a toothpick inserted into the center of the cake comes out clean.", "Remove the cake from the dish and allow it to cool.", "For the frosting; Mix the dark chocolate and the unsalted butter in a heat-proof bowl and stir over hot water till the chocolate dissolves into the butter.", "Remove from heat.", "Cool at room temperature.", "Stir occasionally while cooling.", "Once the cake has cooled sufficiently, spread the chocolate frosting over the cake and allow it to set."
)

c("Preheat oven to 300F (a low temperature, but it works); butter and flour a bundt pan (mine is no-stick but I still butter and flour it).", "With mixer beat butter for a couple of minutes until white; add sugar and extracts and beat a few minutes longer (about 8-9 minutes in all); Add eggs, one at a time, beating after each addition; With mixer on low (to avoid getting flour dust all over the kitchen) add flour, baking powder and salt alternately with yoghurt; beat in ginger; this makes a very thick batter; Spoon into prepared bundt pan and bake for 75 minutes (but start checking with toothpick to see if it's done after an hour (temperatures vary from oven to oven).", 
"Variations:  I often use the 'base' recipe (omitting the ginger) and 'marble some of the batter with cocoa (add a tablespoonful or so of milk and 2 heaping tablespoonfuls of cocoa to 1/3 of the batter); or make a nut cake by stirring in 1 1/2 cups of the flour-dusted, toasted nuts of your choice (a sprinkle of freshly-grated nutmeg is great in this version); our current favourite is chocolate, chocolate/chip where I add 3 tablespoonfuls of cocoa to the batter (along with a couple of tablespoonfuls of milk - or buttermilk if you have it) and then stir in 1 1/2 cups of flour-dusted chocolate chips at the end, before spooning into pan."
)

c("Preheat your oven to 425:", "Fruit:", "Peel the fruit, removing seeds, cores, and stems.", "In a bowl or large measuring cup, Cut all the fruit up to about 1” size.", "Roll the lemon along the counter for a minute or two so more juice.", "Cut the lemon in half, and add 1TBS juice to the fruit.", "Add 1TBS honey, cinnamon, nutmeg, and crush the rosemary as you add it. Add the raisins, and ¼ cup almonds.", "Let this mixture sit while you prepare the shortbread recipe.", "Shortbread:", "Soften the cream cheese in a bowl the microwave for about 20-30 seconds. Add 1 TBS honey, and the other ¼ cup almonds.", 
"Assembly:", "Lay out the foil and put the biscuits on the foil so there will be a serving on each. Using a spoon and a knife spread the cream cheese mixture on each biscuit- dividing evenly among them. Add ½ cup of the fruit mixture on top of each biscuit.", "Take the top edges of the foil and put together, then fold/roll to close. Do the same with the ends to have 4 foil “packages.” Put the packages on a cookie sheet and then into the oven.", "Cook for about 15 minutes or until the fruit mixture is bubbling and any cream cheese has been incorporated."
)

c("1. Combine the flour, sugar, salt, baking powder, and cinnamon, stirring together with a whisk works very well. Add the cranberries, whisk gently, until well distributed.", "2. Measure out the milk, add the oil, and the beaten egg, to the measuring cup with the milk. Mix well.", "3. Pour wet ingredients into dry, stir gently, use a rubber spatula at this stage, stir just enough to combine and moisten, there will be large lumps, don't worry about that.", "4. Put the batter aside, to rest a few minutes.", 
"5. Preheat a non-stick skillet, seasoned with vegetable oil (Put a little oil on a paper towel, and wipe over bottom and halfway up sides of pan.) over medium low heat until a drop of cold water skitters, sizzles, and evaporates.", "6. Pour pancake batter, by 1/4 cupfuls, into hot skillet.", "7. When the surface begins to bubble, and the edges look dry, gently turn them over.", "8. Turn only once.", "9. Serve with either regular syrup (not maple, it would overwhelm) or a little bit of butter and a dash of cinnamon sugar."
)

c("Preheat oven to 350 degrees F with rack in center of oven. Use cooking spray to line cupcake pans.", "In a large mixing bowl, whisk together oil sugar, eggs, yogurt, zucchini, and vanilla (from the \"cupcakes\" part of the ingredients).", "Using a fine mesh strainer, sift flour, cocoa powder, baking powder, and baking soda into the bowl with the wet ingredients. Using a wooden spoon, stir in semisweet chocolate.", "Scoop batter into cupcake pan. Bake for 18 to 20 minutes, or until a toothpick inserted into the center of a cupcake comes out cleanly. Allow cupcakes to cool completely before adding frosting.", 
"For the Frosting: Using a blender or a stand mixer with a whisk attachment, blend remaining coconut oil until it becomes very white and creamy. Add 1 cup of confectioners' sugar, vanilla, and 2 tablespoons of milk and beat until smooth. Add all remaining ingredients except for coconut flakes and blend on low speed until desired consistency is reached.", "Once cupcakes are completely cooled, top with frosting. Sprinkle coconut flakes on the top of each cupcake so it sticks to the frosting.", "Store cupcakes in refrigerator (coconut oil tends to liquefy at room temperature, which will make the frosting run)."
)

c("Grease and flour 1 (12-inch), 1 (9-inch), and 1 (6-inch) round cakepan; set aside.", "Beat butter at medium speed with an electric mixer until creamy; gradually add sugar, beating well. Add egg yolks, 1 at a time, beating well after each addition.", "Combine flour, baking powder, and salt; add to butter mixture alternately with milk, beginning and ending with flour mixture. Beat at low speed until blended after each addition. Stir in extracts.", "Beat egg whites at high speed until stiff peaks form; fold into batter. Spoon 2 cups batter into 6-inch pan, 4 cups batter into 9-inch pan, and remaining batter into 12-inch pan.", 
"Bake at 325° for 40 to 45 minutes or until a wooden pick inserted in center comes out clean. Cool in pans on wire racks 10 minutes; remove from pans, and cool completely on wire racks.", "Wrap layers in plastic wrap to prevent drying; chill.", "NOTE: Layers may be wrapped in aluminum foil and frozen for up to 1 month. Unwrap and thaw at room temperature about 2 hours.", "Makes 1 (12-inch) layer, 1 (9-inch) layer, and 1 (6-inch) layer. Frost as desired.  Add a fruit cream inbetween for added BAM!"
)

c("Line cupcake tins or grease and flour three 8\" cake pans.  Preheat oven 375* for cupcakes, 350* for cake.", "Whisk flour through nutmeg.  Set aside.", "Mix buttermilk, pumpkin, and vanilla.  Set aside.", "Beat butter and sugar with electric mixer until light and fluffy.  Add eggs one at a time- beating well after each addition until batter is smooth and light.", "Alternately add the flour and pumpkin mixtures, blending well after each addition.", "Fill each cupcake with 1/4 cup of batter and bake for 22 minutes.  For cake- bake 35 minutes or until toothpick inserted in middle of cake comes out clean.  Cool in pans for 20 minutes, then remove from pans and cool on wire racks.", 
"For frosting: Blend cream cheese, butter, oj, zest, and vanilla with electric mixer until smooth.  Add sugar and continue to beat for about 3 more minutes.  Stir in food coloring. Stick in fridge until ready to use.", "To frost cakes: trim each layer level and top   each cake with 1/3rd of the frosting, sandwiching one layer on top of the other until it stands a majestic three layers high (frost just the tops of the cakes not the sides- like a German chocolate cake). Refrigerate until ready to serve, then let come to room temperature  Very festive and tastey."
)

c("If using eggs, you must cook in a double boiler first.  Simply add the milk, cream, egg yolks, and sugar and cook till temperature reaches 160 degrees.  Remove from heat and place in ice bath to cool.  When cooled, add vanilla and whisk in cake mix.  Mix well.", "No egg version:  In large bowl, whisk all ingredients ( minus eggs, frosting and candy sprinkles) together till well mixed.", "*Side Note:  Mix can be made ahead of time and kept in refridgerator till ready to use. Place in a 1 gallon container. Shake it up prior to freezing.", 
"Pour into Ice Cream Maker:.", "Freeze according to manufactures directions.  Approx 20 mins, check ice cream. When it begins to thicken, pour in candy sprinkles, and drop by tablespoon fulls, the frosting.  Continue to freeze till unit stops.  Immediately pour into freezer safe container and let \"cure\" in freezer, cover and wrap with plastic wrap.   Let freeze at least 4 hrs or overnight prior to serving.", "To Serve:  Scoop into waffle cones or bowl.  Top with chocolate syrup and whipped topping.  And of course more candy sprinkles!"
)

c("Preheat oven to 350°F.", "Grease and flour a 10 inch tube pan with a removable bottom.", "In a small bowl, combine pecans with the 3/4 cup sugar, cinnamon, and 1 tbsp coffee.", "In a medium bowl, combine flour, baking powder, baking soda, salt,, and remaining coffee.  Set aside.", "Using an electric mixer, beat the butter with a paddle attachment till fluffy. Slowly add sugar, beating till blended, about 2 minutes Scrape down the sides of the bowl.", "On high speed beat for another  2 minute, then reduce speed to low and add eggs one at a time.  Add vanilla and alternate with flour mixture and sour cream in 3 parts till smooth.", 
"Spoon 1/3 of the batter into the prepared pan.  Sprinkle evenly with 1/2 cup of pecan mixture. Top with another 1/3 of the batter, sprinkle with another 1/2 cup of pecan mixture and top with remaining batter, then sprinkle with remaining pecan mixture.", "Bake for about 1 hour 15 minutes or when a toothpick comes out clean.", "Transfer to a rack and allow to cool for about 10 minutes. Loosen edges with a knife.  Invert on to a plate remove the bottom of the pan, then invert again with the nut side up, onto a rack and let cool completely."
)

c("Preheat oven to 350. Grease or line 12 cupcake wells.", "In large bowl, cream together butter and sugar. Add eggs, one at a time, beating well after each addition.", "Sift together flour, baking powder, cinnamon and salt. Add 1/3 of the flour mixture to the butter/sugar mixture, then 1/2 of the cider, and repeat, ending with the last of the flour and mixing only until incorporated.", "Pour into prepared cupcake pan, filling each cup 3/4 way full. Bake 20 minutes or until a toothpick inserted in the center of the cupcake comes out clean. Cool thoroughly, inject with apple butter in the center of the cupcake, then frost.", 
"Frosting Directions:", "Melt brown sugar and 4 tablespoons butter in a saucepan over medium heat. Stir until sugar dissolves. Bring to a boil over medium heat; remove from heat. Whisk in cream; blend well. Transfer to a heat-resistant bowl. Cool at room temperature, stirring occasionally.", "Place remaining 6 tablespoons butter and cream cheese in a large bowl; beat with a mixer on medium-high speed until smooth. Beat in vanilla and salt. With mixer running, slowly pour in cooled brown sugar mixture; beat until smooth. Add powdered sugar gradually, beating well after each addition until completely smooth. Chill slightly for a firmer texture, stirring occasionally."
)

c("If you are using whole hazelnuts, preheat the oven or oven toaster to 350ºF/180ºC. If you are using hazelnut meal, skip to step 4.", "Toast the whole hazelnuts for about 10 minutes until fragrant. Set aside and cool.", "Place the cooled hazelnuts in a food processor and grind to make hazelnut meal. Do not over-process. If you do, it will turn into nut butter.", "In a small pan, melt butter and chocolate under very low heat.", "Preheat oven to 350ºF/180ºC. Spray oil inside a 9-inch springform pan.", 
"In a bowl, beat mascapone cheese until creamy. Add sugar and beat again.", "Add eggs and beat until creamy.", "Add the chocolate mixture, vanilla and liquor (if using) and mix well.", "Add hazelnut meal, salt, and cinnamon and mix well.", "Bake for about 40 – 45 minutes. Set aside and cool.", "When the cake is cooked, remove the pan and place the cake on a cake plate.", "Dust cocoa powder and powdered sugar using a stencil (see note above).", "Infuse love and serve with whipped cream and/or ice cream if desired."
)

c("Pre-heat the oven to 200°C/gas 6.", "Put the potato slices in a colander and rinse under running water to get rid of the starch. Place on a cloth in a single layer and pat dry.", "Generously grease the base of an ovenproof pan or baking dish with melted butter.", "Arrange the potato slices in the pan in overlapping circles , brushing butter over each layer and seasoning as you go.", "Cover with greaseproof paper or a lid. Bake in the oven for 45minutes or up to 1 hour. Test with a skewer to see if the potatoes are done.", 
"Cooks Notes:", "Cook this in a cast-iron, heavy-bottomed, stubby-handled frying pan that goes in the oven. Traditionally it should be lidded - mine isn't, so I use greaseproof paper.", "Historical Note:", "Mrs. Landemare's original recipe is:", "Potatoes. Fresh butter.", "Peel some potatoes and cut into very thin rounds the size of a florin. Wash in salted water and dry very well in a cloth. Well butter an omelette pan. Place a layer of potatoes on the bottom. Cover with oiled [melted] butter, pepper and salt. Repeat these layers until the pan is full and cook in a medium [350°F] over until brown [40-60 min.] Remove from the oven, turn out and cut into slices or serve whole in a dish."
)

c("Preheat your oven to 325°F; lightly coat a 10\" fluted tube pan with cooking spray; lightly sprinkle with flour. Set aside.", "In a bowl combine the 3 cups flour, cinnamon, nutmeg, baking soda, chipotle powder(if using), ginger, white pepper, salt, and cloves; set aside.", "In a mixing bowl beat oil and sugar with electric mixer on medium speed until combined. Add eggs, one at a time; beat well after each addition. Beat in vanilla and as much flour mixture as you can. Stir in remaining flour mixture, apples, and pecans. Spoon batter into pan.", 
"Bake 1 1/4 hours at 325°F, until wooden toothpick inserted near center comes out clean. Meanwhile, prepare the glaze.  Cool cake in pan 10 minutes; invert on rack. Place rack over baking sheet. Drizzle warm cake with the glaze, respooning glaze that drips on baking sheet over the cake. Cool completely before serving.", "To make glaze:", "In a saucepan combine the brown sugar, butter, whipping cream and chipotle pepper (if using). Bring to boiling, stirring occasionally. Boil gently 2 minutes. Remove from heat. Stir in vanilla and let stand 1 1/4 hours until slightly thickened. Drizzle over the warm cake. Enjoy!"
)

c("In a medium skillet, heat the butter; add the scallions, celery, and garlic, and cook over medium heat until the vegetables are translucent, about 3 to 4 minutes.", "In a medium bowl, combine the cooked vegetables with the crab, eggs, lemon juice, mustard, and parsley.", "Season with the salt, pepper, and nutmeg.", "Add the cracker meal and stir well to combine thoroughly.", "Form heaping tablespoons of the crab mixture into 1-1/2 inch-round cakes.", "Roll the cakes in additional cracker meal and place them on a baking pan.", 
"Refrigerate for at least 30 minutes before cooking.", "When ready to serve, heat a large skillet and pour the oil to a depth of 1/2-inch; heat the oil over medium heat, keeping the oil at a low simmer.", "Cook and brown the crabcakes for 1 to 2 minutes on the first side and about 1 minute on the second side, or until they are cooked through and golden brown.", "Transfer the cakes to paper towels to drain. Serve the cakes warm, with the Remoulade sauce.", "-=Remoulade Sauce=-", "In a small bowl, whisk all of the ingredients together and refrigerate until ready to serve; makes 1 cup."
)

c("For the Crust:.", "Mix the flour and sugar in mixing bowl. Add the butter and eggs, mix well with hands. Shape into a ball and chill, wrapped in plastic wrap for 15 minutes.", "Roll the dough into a circle 11 inches in diameter and 1/4 inch thick on a lightly floured surface.", "Cut into a 9 inch circle to fit into a 9 inch springform pan. Prick all over with a fork.", "Bake at 350 for 15 minutes or until light brown. Cool to room temperature before putting in the filling.", "For the Filling:.", 
"Beat cream cheese and brown sugar in mixing bowl until light and fluffy.", "Beat in the cream, cornstarch, bourbon and vanilla.", "Combine the pumpkin, eggs, cinnamon, nutmeg, ginger and salt in a bowl ans whisk until smooth.", "Add to the cream cheese mixture and beat until smooth. Spoon over the cooled crust.", "Bake at 350 for 50 minutes or until the center is set.", "Cool to room temperature. Chill, covered in the refridgerator.", "Place on a serving plate and remove sides os springform pan."
)

c("Preheat oven to 180 degrees celsius.", "Line one 12-cup muffin tin with cupcake papers.", "In a small bowl, combine the flours. Set aside.", "In a large bowl, on the medium speed of an electric mixer, cream the butter until smooth. Add the sugar gradually and beat until fluffy, about 3 minutes.", "Add the eggs, one at a time, beating well after each addition. Add the dry ingredients in three parts, alternating with the milk and vanilla. With each addition, beat until the ingredients are incorporated but do not overbeat.", 
"Using a rubber spatula, scrape down the batter in the bowl to make sure the ingredients are well blended. Carefully spoon the batter into the cupcake liners, filling them about three-quarters full.", "Bake for 20–25 minutes, or until a cake tester inserted in the center of the cupcake comes out clean.", "Cool the cupcakes in the tins for 15 minutes. Remove from the tins and cool completely on a wire rack before icing. Ice the cupcakes with either Vanilla Buttercream or Chocolate Buttercream.", "NOTE: Take your time to make your cupcakes rather than rushing them and you will have the perfect cupcake. After 15 minutes, if your oven cooks slightly unevenly, rotate the muffin tin to ensure one lot aren't burnt and the others aren't undercooked."
)

c("FOR CHEESECAKE: Line base & sides of a 1 1/2 qt microwave loaf dish w/oiled greaseproof paper.", "Beat butter, sugar & honey. Gradually add beaten eggs. Beat in cheese, lemon rind & juice (or lime if using), sour cream, cornstarch & vanilla extract. Mix till smooth & fold in the chopped sultanas.", "Spoon mixture into prepared dish, cover w/greaseproof paper & cook on DEFROST for 20 minutes. Remove cover.", "FOR BASE: Place butter & syrup in a bowl & microwave on HIGH for 1 minute. Stir in the crushed cookie crumbs. Spoon cookie mixture on top of cheesecake & press down slightly. Allow to fully cool & then refrigerate till needed.", 
"TO SERVE: Carefully invert the cheesecake onto a chilled serving plate & remove the greaseproof paper. Decorate w/whipped cream + fruit per note below, slice thinly & serve immediately.", "NOTE: The pic showed sliced fruit layered in rows on both sides of the cheesecake & a row of whipped cream in the centre. Use alternating slices of strawberries & kiwi for a X-Mas theme, strawberries for a Valentine theme, kiwi for a St. Pat’s Day theme or rows of strawberries, bananas & blueberries for a 4th of July theme. I will likely use a canned spray cream right b4 serving for its ease & do without the need to use & whip the double cream. I admit I'm lazy, but I also don't think this needs the added richness, calories & fat of double cream :-)."
)

c("Preheat oven to 325 degrees.", "CRUST:  Mix the cookie crumbs and butter until crumbs are moistened.  Press into the bottom of a 9 inch spring form pan.  Freeze, uncovered, until filling is ready.", "FILLING:  Stir together pumpkin, vanilla, cinnamon , ginger, nutmeg, cloves and allspice until just combined.  Set aside.", "In a large mixing bowl with paddle attachment, beat the cream cheese on medium-high for three minutes.  Add the brown sugar and beat for two minutes.  Add the eggs, one at a time, beating after each addition.  Add the pumpkin mixture;  mix on low until incorporated.", 
"Pour the batter over the crust, smoothing it out to touch the sides of the pan.  Bake 45 to 50 minutes or until the cheesecake starts to pull away from  the sides of the pan but is still loose in the center.", "Cool on a wire rack for two hours.  Refrigerate for at least two  house before decorating or serving.", "TOPPING:  In a small bowl, blend together sugar and cinnamon.  Usisng a fine-meshed sieve, dust mixture over top of cooled cheesecake.", "For additional garnishes, pipe whipped cream around the edge and serve with whole gingersnaps."
)

c("Preheat oven to 425°F Spray large baking sheet lightly with non-stick cooking spray. Sift flour, baking powder and salt into food processor bowl. Add sugar. Pulse just enough to blend dry ingredients. Add butter and pulse until largest pieces are the size of fat peas.", "In a small bowl, lightly beat together eggs, tea and the 1/4 cup of milk. Add all at once to flour and butter mixture. Pulse a few times to distribute the wet mixture. Add the remaining milk a spoonful at a time and pulse just until dough comes together in a soft but not sticky ball.", 
"Turn dough out onto a lightly floured surface. Add a little extra flour if the dough seems sticky and difficult to handle. Sprinkle cranberries and lemon zest on dough and gently knead into a rough ball. Roll and pat into a long log shape. Then bring ends together into a ring. Place on baking sheet and cover with plastic wrap and chill 10 minutes to allow gluten in the dough to relax.", "Place baking sheet in center of oven and bake for 25 minutes. Meanwhile, lightly beat glaze ingredients. Remove cake from oven and brush all over with glaze. Return cake to oven for an additional 15 minutes, or until it turns a rich golden brown. Transfer the cake to a wire rack to cool. Stir together icing ingredients until smooth and runny. Dribble over just warm cake, allowing it to drip down sides. Best eaten as soon as possible."
)

c("For the cake:.", "Preheat the oven to 350 degrees F. Lightly oil and flour a 13 by 9-inch metal pan and set aside.", "Whisk together the cake flour, baking powder and salt in a medium mixing bowl and set aside.", "Place the butter into the bowl of a stand mixer. Using the paddle attachment, beat on medium speed until fluffy, approximately 1 minute. Decrease the speed to low and with the mixer still running, gradually add the sugar over 1 minute. Stop to scrape down the sides of the bowl, if necessary. Add the eggs, 1 at a time, and mix to thoroughly combine. Add the vanilla extract and mix to combine. Add the flour mixture to the batter in 3 batches and mix just until combined. Transfer the batter to the prepared pan and spread evenly. This will appear to be a very small amount of batter. Bake on the middle rack of the oven for 20 to 25 minutes or until the cake is lightly golden and reaches an internal temperature of 200 degrees F.", 
"Remove the cake pan to a cooling rack and allow to cool for 30 minutes. Poke the top of the cake all over with a skewer or fork. Allow the cake to cool completely and then prepare the glaze.", "For the glaze:.", "Whisk together the evaporated milk, sweetened condensed milk and the half-and-half in a 1-quart measuring cup. Once combined, pour the glaze over the cake. Refrigerate the cake overnight.", "Topping:.", "Place the heavy cream, sugar and vanilla into the bowl of a stand mixer. Using the whisk attachment, whisk together on low until stiff peaks are formed. Change to medium speed and whisk until thick. Spread the topping over the cake and allow to chill in the refrigerator until ready to serve."
)

c("Chocolate Buttercream, recipe follows", "Preheat the oven to 350 degrees F. Butter 2 (8-inch) round cake pans. Line with parchment paper, then butter and flour the pans.", "Sift the flour, sugar, cocoa, baking soda, baking powder, and salt into the bowl of an electric mixer fitted with a paddle attachment and mix on low speed until combined. In another bowl, combine the buttermilk, oil, eggs, and vanilla. With the mixer on low speed, slowly add the wet ingredients to the dry. With mixer still on low, add the coffee and stir just to combine, scraping the bottom of the bowl with a rubber spatula. Pour the batter into the prepared pans and bake for 35 to 40 minutes, until a cake tester comes out clean. Cool in the pans for 30 minutes, then turn them out onto a cooling rack and cool completely.", 
"Place 1 layer, flat side up, on a flat plate or cake pedestal. With a knife or offset spatula, spread the top with frosting. Place the second layer on top, rounded side up, and spread the frosting evenly on the top and sides of the cake.", "Next make the frosting:.", "Chop the chocolate and place it in a heat-proof bowl set over a pan of simmering water. Stir until just melted and set aside until cooled to room temperature.", "In the bowl of an electric mixer fitted with a paddle attachment, beat the butter on medium-high speed until light yellow and fluffy, about 3 minutes. Add the egg yolk and vanilla and continue beating for 3 minutes. Turn the mixer to low, gradually add the confectioners' sugar, then beat at medium speed, scraping down the bowl as necessary, until smooth and creamy. Dissolve the coffee powder in 2 teaspoons of the hottest tap water. On low speed, add the chocolate and coffee to the butter mixture and mix until blended. Don't whip! Spread immediately on the cooled cake."
)

c("Butter and dust with flour 2 9x13 pans.", "Combine  the  first 6 ingredients for the Coconut cake Layer  in a mixing bowl and beat on medium speed for 3 minutes.", "Pour into 1 of the prepared pan and bake for 30-45 minutes until toothpick comes out clean.", "Cool at room temperature for 15 minutes.", "Invert onto rack and brush 1/4 cup coconut rum over cooled cake.", "Let sit for 1 hour.", "Combine  the  first 6 ingredients for the Chocolate Almond cake Layer  in a mixing bowl and beat on medium speed for 3 minutes.", 
"Pour into prepared pan and bake for 30-45 minutes until toothpick comes out clean.", "Cool at room temperature for 15 minutes.", "Invert onto rack and brush 1/4 cup almond liqueur over cooled cake.", "Let sit for 1 hour.", "Meanwhile cream butter, salt, and extracts, beating until light and fluffy. Add sugar gradually, beating after each addition. Add milk, beating until smooth. Beat in additional  milk until desired spreading consistency is reached.", "Frost cooled cake and garnish with toasted coconut!"
)

c("To Prepare Cake Batter: In a very large bowl cream the butter (1 cup) until light, slowly adding the granulated sugar and continuing to beat until the mixture is light and fluffy. Blend in one egg at a time.", "In another bowl sift together the flour, soda and salt. Add the flour mixture alternately with the buttermilk to the creamed mixture, beginning and ending with the flour. Beat well after each addition. Mix in the rind and the juice (2 tablespoons each). Pour the batter into a greased and lightly floured 10-inch tube pan or a 12-cup bundt pan.", 
"Bake in a preheated 325F oven for 65-75 minutes or until a toothpick inserted in the center comes out clean. Place the pan on a rack to cool for 10 minutes then turn the cake out onto a rack and spread with as much Lemon Glaze as the cake will absorb (about 1/3 to 1/2 of the icing). Allow cake to cool completely, then frost with the remaining icing.", "To Prepare Glaze:  In a mixing bowl blend together thoroughly the 1/4 cup of butter and the confectioners sugar. Mix in the remaining rind and juice, one tablespoon at a time, until the frosting is of spreading consistency. If the entire amount of lemon is used, the icing will be thin and runny. However a very tangy frosting greatly enhances the flavor of the cake. Thin frosting may be chilled a few minutes to make it easier to spread. Or you may want to add a little more confectioners sugar to the icing that remains to be spread on the cooled cake."
)

c("Preheat oven to 375 degrees F. Grease and flour a 10 inch Bundt pan (10-15 cup pan.) Sift together the 2 ¼ cups of flour, baking soda and salt. Mix in the lemon zest and set aside.", "With an electric mixer, cream together the butter and sugar until light and fluffy. Beat in the eggs one at a time, then stir in 1 Tb. lemon juice. Alternate beating in the flour mixture and the yogurt, mixing just until incorporated.", "Toss the strawberries with the remaining ¼ cup of flour. Gently mix them into the batter.", 
"Pour the batter into the Bundt pan. Place in the oven and reduce the temperature to 325 degrees F. Bake for 60 minutes, or until a toothpick inserted into the center of the cake comes out clean.", "Allow to cool at least 20 minutes in the pan, then turn out onto a wire rack and cool completely. Once cooled whisk together the remaining 2 Tb. of lemon juice and the powdered sugar. Drizzle over the top of the cake.", "** Note I have made this cake in advance, it freezes really well then drizzle with glaze before serving."
)

c("Preheat oven to 350°-- I bake at 300° for 20 minutes then increase oven temp to 325° or you could use bake even strips.", "Prepare pans with cooking spray and parchment.", "Melt the chocolate in the top of a double boiler, stirring frequently-- remove from heat before chocolate is completely melted; stir until chocolate is melted and smooth-- cool to room temperature.", "Meanwhile, sift together the flour, baking powder, salt and set aside.", "Place the butter in the bowl of your mixer, and with the flat paddle, cream butter.", 
"Add the sugar gradually and continue to beat until light and fluffy, about 1 to 2 minutes-- scrape down the bowl once or twice and beat in the vanilla.", "Add the eggs, one at a time, beating well after each addition.", "Scrape in the melted chocolate and beat until the batter is smooth.", "Add the dry ingredients alternately with the milk in 3 separate batches.", "Pour into prepared pans.", "Bake about 30-40 minutes, or until a toothpick tests clean or cake just begins to pull away from the sides of the pan-- do not overbake."
)

c("In mid sized sauce pan, put sugar, water, carrots, raisins, butter and spices, bring to boil turn down and simmer five minutes.", "Remove from heat, cover and rest for 12 hours, Comment on the recipe  \"the secret of this cake is to let the boiled ingredients stand for twelve hours\" I have always followed this step.", "Then add the baking soda mixing to dissolve, add the flour, salt and baking powder. Lastly fold in the nuts (if you decide to also add the glazed fruit as I do for the holidays, fold these in as well).", 
"Put the batter into two well greased loaf pans or 1 tube pan  --  (as with many of the old recipes I use my judgement on the loaf pans) Have used the 8 1/2 x 4 x 2 1/2. One friend makes these for gifts using a number of small sized loaf pans. I would think it depends on the size loaf you are wanting.", "Bake 275 for 2 hours. This may vary from oven to oven.", "Cool and wrap  --  I like to leave this one mellow a few days before using. Keeps well. Yield depends on serving size but should make for 10 to 12 servings."
)

c("Preheat oven to 325 degrees.  Line 13x9 baking pan with aluminum foil and allow end to extend over the sides of the pan.", "Mix the cookie crumbs and melted butter and press firmly into the bottom of the prepared pan.  You can use a measuring cup or the bottom of a glass to press the crust.  Bake the crust for 10 minutes.", "Beat cream cheese, sugar and vanilla in a large bowl with an electric mixer on medium speed until well blended.  Add sour cream and mix well.  Add eggs one at a time beating on low speed after each addition just until blended.", 
"Remove 1 Cup of the batter and set it aside.  Stir melted chocolate into remaining batter in large bowl.  Pour mixture over the crust.", "Top with spoonfuls of the remaining 1 Cup of plain batter.", "Cut through the batters with a knife several times to create the swirl effect.  Bake 40 minutes, or until center is almost set.  Cool completely and refrigerate for at least 4 hours or overnight.  Use the foil handles to lift the cheesecake out of the pan before cutting to serve.  Keep leftovers in refrigerator."
)

c("Beat butter and sugar at medium speed with an electric mixer until light and fluffy. Add eggs, 1 at a time, beating until blended after each addition. Add pumpkin, beating until blended.", "Combine flour and next 4 ingredients. Combine buttermilk, vanilla, and ginger. Add flour mixture to butter mixture alternately with gingered buttermilk, beginning and ending with flour mixture. Beat at low speed after each addition. Fold in chopped pecans.", "Pour batter into 2 greased, parchment paper-lined 9-inch round cakepans.", 
"Bake at 350 degrees for 18 - 20 minutes or until a wooden pick inserted in center comes out clean. Cool in pans on wire racks 10 minutes; remove from pans, and cool completely on wire racks.", "Spread Ginger-Cream Cheese Frosting between layers and on top and sides of cake. Cover and chill overnight.", "GINGER-CREAM CHEESE FROSTING (ingredients above):  Beat first 3 ingredients at medium speed with an electric mixer until light and fluffy. Gradually add powdered sugar, beating until smooth. Add vanilla, beating until smooth. Chill 30 minutes or until spreading consistency. Yield: 2 1/4 cups."
)

c("Pre-bake pie shell according to package directions for a single-crust pudding pie. Remove from oven.", "Put juice and sugar in saucepan and heat on medium stirring frequently. While this mixture is heating, make a slurry with the cornstarch, red glaze mix, and cold water. ONLY use as much water as you need to make the slurry pourable and not thick. When the juice and sugar is simmering and the sugar has dissolved completely, slowly stir in corn starch mixture and stir continually. When mixture is fully thickened it will be not quite pudding consistency, but not really pourable either. Mix fresh berries gently into thickened liquids. Scoop gently into pie crust and chill at least 3 hours, or until cooled completely.", 
"Put softened cream cheese in medium sized mixer bowl. Beat cream cheese and powdered sugar until smooth. SLOWLY add in milk and mix well so that it fully incorporates into the cream cheese. When all of the milk is mixed in well and the mixture is smooth, add in pudding mix and mix according to package directions.", "Place pudding mixture into large gallon sized baggie and chill one hour. When fully chilled, snip a corner of the tip and pipe onto the pie in a lattice pattern, if you are feeling creative, or however you'd like if you are not! Garnish with little dollops of raspberry jam if you want to, then cut into and enjoy!"
)

c("Combine crushed wafers and butter in a bowl.", "Press firmly over the base of a greased 20cm springform pan.", "Cook in a 180 degree C oven for 10 minutes and cool.", "Beat cream cheese, sugar and essence until well combined.", "Beat in eggs, one at a time.", "Transfer half the mixture to another bowl.", "Stir melted white chocolate and liqueur into one half and melted dark chocolate into the other half.", "Pour dark chocolate mix into prepared pan.", "Gently spoon white mixture over the top of the dark mix for a layered effect.", 
"Cook in a 190 degree C oven for 10 minutes.", "Reduce heat to 120 degree C and cook another hour, or until just firm.", "A slight jiggle in the middle is fine.", "Cool cheesecake overnight in fridge.", "When ready to glaze melt the remaining chocolate, butter and oil in a bowl over simmering water.", "Stir until smooth.", "Spread warm glaze over top of cheesecake and allow to set.", "Run a knife around the edge of cheesecake before removing from pan.", "Decorate with berries and orange segments."
)

c("In a food processor, take day old bread and pulverize to make fresh breadcrumbs, this is very important, store bought breadcrumbs will not suffice here. Place aside in a bowl.", "Using on/off pulses with the same foodprocessor, finely chop the first 3 ingredients.", "Dump into a medium bowl and add the next 5 ingredients and stir to combine.", "Then add the crabmeat; toss.", "GENTLY fold in 1 cup breadcrumbs.", "Place 2 cups breadcrumbs on plate.", "Using 1 tablespoon crab mixture for each, form 1-inch-diameter patties.", 
"Coat each crab cake with breadcrumbs.", "Cover; chill at least 1 hour.", "Working in batches, lighlty sautee the crabcakes in butter, until golden brown on each side.", "Transfer onto paper towel, keep warm till serving.", "Serve with Herb Sauce on side.", "Garnish with Basil or Chive Sprigs.", "Herb Sauce Preparation:", "place all ingredients except 2 tablespoons of the capers into a blender or a food processor.", "Blend until smooth and pleasingly green.", "Pour into a bowl and stir in additional 2 tablespoons of capers."
)

c("Cake:", "Preheat oven to 350.  Grease 3 (9-inch) round cake pans, dust with flour, and line bottom with parchment or wax paper.", "Sift together flour, cocoa powder, baking powder, and salt.", "Blend milk, oil, and vanilla extract in a separate bowl.", "In a large mixing bowl with electric mixer on medium speed, cream butter with sugar until light and fluffy.  Add eggs one at a time, beating well after each addition.", "Add flour mixture to butter mixture alternately with milk mixture, beating after each addition just until smooth.  Divide batter evenly into prepared pans.", 
"Bake 25 minutes or just until a knife or toothpick inserted in the center of layers comes out clean.  Remove from oven, cool 10 minutes on a wire rack.  Remove from pans and allow layers to cool completely before icing.", "Icing:", "Combine chocolate chips and condensed milk in saucepan over gentle heat and stir continuously until chocolate has melted completely.  Remove from heat and stir in sour cream.  Add coconut, stir until combined, and allow icing to cool slightly.  Frost between layers, and top and sides of cake before icing has completely cooled."
)

c("For Cake:", "In large mixing bowl, combine butter, vinegar, vanilla and lukewarm water.", "In another bowl sift flour sugar,cocoa, curry powder,baking soda and salt.", "Pour dry ingredients slowly into butter mixture. Mix on low speed with mixer. Use spatula to scrape the sides and blend until smooth.", "Preheat oven 350*.", "Spray pam on two round baking pans.", "Sprinkle flour on sprayed pans. Shake off excess.", "Bake for 35 to 40 minutes or until a toothpick inserted in center comes out clean or when you press on the top, the dent comes back then the cake is done. Cool on racks.", 
"For Filling:.", "In small saucepan add filling ingredients.Bring to a boil and then simmer until jelly consistency. Stir frequently. Do not burn.", "Set aside. When cool, spread between the two cake layers.", "For Frosting:.", "In another saucepan heat cream, butter, yellow curry and corn syrup. Bring to a boil and stir.", "In stainless steel bowl add chocolate pieces.", "Pour boiling cream mixture over chocolate pieces. Leave for 5 minutes. Stir to mix.", "Pour over cool cake and spread with spatula. Cool until serving."
)

c("Make the filling a day in advance. Bring the cream to a boil and add to a chopped chocolate. Stir gently until chocolate melted and allow to cool. Keep refrigerated until next day.", "Preheat oven at 375°F Draw eight 8-inch circles on a parchment paper.", "Whip egg whites with cream of tartar until stiff peaks adding gradually 1/3 cup of sugar. Set aside.", "Whisk egg yolks with remaining sugar until light and fluffy. Stir sifted cocoa powder into boiling water. Add slowly to the yolks.", "Sift flour and cornstarch over yolk mixture, add 1/3 of the whipped whites and fold in gently. Repeat with remaining whites.", 
"Spoon 1/2 cup of the batter into drown circles and bake for 5-8 min until springs back, when touched. Allow to cool.", "For the syrup, bring water and sugar to a boil. Remove from the heat and stir in liqueur.", "Whip cooled filling. Moisten prepared cake circles with syrup and spread with chocolate filling. Also cover sides and top of the cake with the filling and sprinkle with chocolate curls and shavings.", "To make a truffles, heat the cream to just below a simmer and pour over chopped chocolate. Stir gently to blend, stir in liqueur of your choice and let cool in the fridge for about 1 hour before making truffles. Spoon small teaspoonfuls of chocolate filling and roll into balls. Place on a baking tray and freeze for 30 minutes. Dip truffles in melted chocolate (using a toothpick) and place on a clean tray. Once the coating is set, dust with cocoa powder."
)

c("Preheat the oven to 350°F Line 24 cupcake cups with paper liners. Set pans aside.", "Use 12 Oreos and split them in twos, place cookie halves in the bottom of each paper liner, cream side up. Toss the extra Oreos in a closed zipper-lock bag and crush them by easing a rolling pin over the bag. Set these aside.", "Blend sour cream, oil, eggs, and vanilla in a large mixing bowl and fold in cake mix. Use box directions for blending tips. Then measure out 1 1/2 cups of the crushed Oreos and fold these into the batter until well distributed. Set aside the remaining crushed Oreos for the frosting and or garnish. Spoon or scoop batter until each paper liner is 3/4 full. Place the pans in the oven.", 
"Bake the cupcakes until they are lightly golden for 18 to 20 minutes. Remove the pans and let them cool for 5 minutes before removing liners. After 5 minutes, remove the individual cupcakes and place them on a wire rack to cool for 15 minutes before frosting.", "For the frosting use a packaged 16oz can (Vanilla) or your own favorite recipe. Soften and fold in remaining Oreo crumbles to your liking and put some aside to garnish as well.", "**Keep well sealed at room temp(lasts about 3 days) or refrigerate (up to a week), to your liking."
)

c("Grease a 13 x 9-inch baking pan or a 10-inch springform pan.", "To make the cake: In a bowl, combine the wafer crumbs and melted butter.", "Press into bottom of prepared baking dish.", "Place in freezer for 20 minutes.", "Remove from freezer and spread 1 quart of ice cream over the crumb crust.", "Sprinkle the crushed Skor bars over the ice cream, and press in slightly with a back of a spoon.", "Carefully spread remaining 1 quart of ice cream over the crushed bars.", "Sprinkle with chopped peanuts.", 
"Freeze for 3-4 hours.", "To make the Sauce: In a small saucepan, melt butter over low heat.", "Stir in the brown sugar, the half and half cream and whipping cream; cook, stirring constantly over low heat until sugar has dissolved.", "Remove from heat and add/mix in vanilla.", "TO SERVE: Remove cake from freezer and pan (if you are using a springform pan) if not just cut into squares if you are using a 13 x 9-inch pan.", "Pour the slightly cooled or cold toffee sauce over the cake.", "DELICIOUS!"
)

c("Cake:", "Preheat oven to 350°F Butter and flour three 9-inch-diameter cake pans. Line the bottoms with parchment paper, then butter and flour the parchment paper. (Or, line cupcake pans with paper liners).", "In large bowl, cream together butter and sugar with electric mixer. Add peanut butter and vanilla and cream well. Add eggs one at a time, mixing well after each.", "In separate bowl, whisk together dry ingredients.", "Add dry ingredients to peanut butter mixture alternately with sour cream and milk. Mix on low speed just until blended.", 
"Pour cake batter into prepared pans (approximately 2 cups per pan), spreading evenly in pans. (Or, fill cupcake cups 2/3 full).", "Bake for 15- 20 minutes or until tester inserted into center of cake comes out clean. Do not over bake. Remove from oven and cool cakes in pans on rack 10 minutes.", "Run small sharp knife around pan sides to loosen cakes. Turn cakes out onto racks and cool completely.", "Frosting:", "In large mixing bowl, beat butter until creamy.  Mix in maple syrup and vanilla.  Gradually mix in powdered sugar until desired consistency is reached."
)

c("Peel and section oranges and grapefruit over a bowl to reserve juices.", "Add oranges, grapefruit, jicama, and radishes to reserved juice.  Chill until ready to assemble salad.", "Make dressing by stirring together lime rind, lime juice, yogurt, mayo, honey, and black pepper.", "To make shrimp cakes chop shrimp, then stir together curry powder, breadcrumbs, coconut, red bell pepper, green onions, ginger, coconut milk, soy sauce, shrimp, eggs, and garlic.  Refrigerate for an hour.", "Spray a large skillet with cooking spray and heat to medium-high.", 
"Form 16 patties from shrimp mixture and flatten to approximately 1/2 thickness.", "Brown 8 shrimp cakes at a time for 4-6 minutes on each side.  Remove pan from heat, cover pan, and let cakes sit in pan for 5 minutes.  Remove shrimp cakes from pan and repeat cooking with remaining 8 raw shrimp cakes.", "To plate entree salad, add romaine lettuce to 8 plates.  Using a slotted spoon, evenly divide the orange mixture between the 8 plates.  Place 4 shrimp cakes on each salad.  Drizzle each salad with 1 tablespoon of dressing."
)

c("Melt the butter in a small pot over medium heat until it's brown and gives off a deliciously nutty aroma. This can take anywhere from 10 to 20 minutes. You want the butter solids nicely toasted, but not scorched. Stir in the toasted hazelnut oil. Set aside and allow to cool but not set. By doing the butter first you can complete the rest of the steps while it is cooling.", "Preheat oven to 350F / 180C with a rack in the top 1/3. Butter and flour a 1-lb loaf pan, or roughly 9x5x3-inch.", "Sift the flour, baking soda, cinnamon, garam masala, and sea salt into a large bowl. Set aside. In a smaller bowl whisk the sugar, eggs, squash, and milk. Whisk in the still melted butter, but make sure it isn't hot to the touch. Add the wet ingredients to the flour mixture, and stir until just combined. Fold in most of the almonds.", 
"Pour the batter into the prepared pan, sprinkle with 1 1/2 tablespoons of sugar and remaining almonds, and bake for about 50-60 minutes, or until the edges have browned and the center of the cake is well set. Do your best to avoid over-baking, part of the charm of this cake is its moistness, when it is baked properly. Use a cake tester if necessary.", "*To make pureed winter squash: Roast large wedges or small cubes of skinned and seeded pumpkin, butternut squash, red kuri squash, etc. in a 375F / 190C until cooked and tender throughout. Puree with a hand blender until smooth."
)

c("(This recipe has three separate portions to combine together: the cake, the cinnamon mixture, and the frosting.) Combine cake ingredients and mix for 5 minutes in mixer on medium speed.", "Combine cinnamon mixture.", "Butter the sides and bottom of Bundt or angel food tin.", "Sprinkle part of cinnamon mixture into pan covering sides and bottom.", "Then pour cake batter into pan in three alternating layers with cinnamon mixture, ending with cinnamon mixture.", "Bake at 350°F for 35 to 40 minutes, checking to make sure the sugar on the outside of the cake does not burn.", 
"Let cool; place on serving plate.", "Mix together powdered sugar and enough milk to make a \"drizzly\" consistency of frosting, then drizzle over the sides (both inside and outsides).", "Let frosting set before serving.", "Note:  if your oven runs hot, you might want to try baking for 35 minutes to begin with, then remove cake from oven and taste-check a portion of the cake which doesn't show easily (such as the inner ring) to make sure the sugar coating isn't burning and the cake isn't drying out.  Thank you, Michelle S., for the input that prompted me to edit the recipe for this!  :)."
)

c("Preheat oven to 350°F.", "Use a 9 inch springform pan.", "With pan locked, coat inside of pan with a thin film of butter.  This will help alumnium foil to adhere to contour of pan.  Place sheet of alumnium foil inside pan and press along bottom and sides.", "This step will prevent batter from leaking during baking.", "In heavy saucepan, over low heat, combine butter, sugar, and coffee; stir until all is melted.", "Remove from heat.", "In separate bowl, beat eggs (by hand or electric mixer) a couple of minutes, until slightly thickened.", 
"Stir in chocolate and mix to a uniform color.", "Pour in pan and bake for 50 to 60 minutes.", "Cake will fall slightly as it cools.", "When room temperature, open springform pan, peel foil away from sides, place serving plate on top and flip over.  Remove remaining foil.", "Serve at room temperature.", "Note:  This cake is rather hard to slice, use plain dental floss or kitchen string, and holding taut in both hands, slice through cake, dividing it as you go.", "For Christmas, decorate center with holly leaves and cranberries."
)

c("Preheat the oven to 350F and grease a 10-inch springform pan with butter or oil.", "In a large mixing bowl, whisk together the flour, cocoa powder, baking soda, baking powder, and salt. In a food processor, process the sugar and butter until creamy (you can also do this by hand, armed with a sturdy spatula or in a stand mixer). Add the vanilla, coffee granules, and eggs, mixing well between each addition.", "Reserve a cup of the flour mixture and add the rest to the egg mixture. Mix until just combined; the batter will be thick.", 
"Add the zucchini and chocolate chips to the reserved flour mixture and toss to coat. Fold into the batter and blend with a wooden spoon-don’t over mix. Pour into the prepared cake pan and level the surface with a spatula.", "Bake for 40 to 50 minutes, until a knife inserted in the center comes out clean.", "Transfer to a rack to cool for 10 minutes, run a knife around the pan to loosen the cake, and unclasp the sides of the pan.", "Let cool to room temperature before serving.", "Sprinkle with confectioners’ sugar, glaze with melted chocolate, or decorate with a few slices of raw zucchini (you don’t have to eat them, though)."
)

c("Preheat oven to 350°F  Coat a 9 x 12-inch baking sheet with 1-inch high sides with nonstick spray; line with parchment paper and spray again.", "Mix together flour, sugar, baking powder, and salt.", "In another bowl, blend egg yolks, oil, water, lemon extract, and zest.  Gradually whisk flour mixture into yolk-oil mixture until smooth.", "Beat egg whites in a bowl with an electric mixer on medium-high speed until frothy.  Gradually add 1/8 cup sugar to the whties and continue beating until they-re shiny and hold firm peaks as beaters are lifted out.  Whisk 1/3 of the beaten whites into the batter to lighten it; gently fold in the remaining whites with a whisk.", 
"Pour batter onto the prepared baking sheet.  Tilt the pan to evenly spread the batter (don't use a spatula--it can deflate the whites), then bake the cake 12-13 minutes, or until just set.  Cool to room temperature, remove from pan, peel off paper, and cut into 1 1/2-inch rounds.  (Don't cut rounds too big, or assembled cakes will be floppy when picked up).", "Whip cream and lemon curd together for the lemon cream, beating to soft peaks.  Dollop 1 tablespoon cream on each cake round.", "Top cakes with berries, dust with powdered sugar, then garnish with mint.  Serve or chill up to 2 hours."
)
